var ISet=function(t){this.elements={};if(t&&t.length){for(var e=0;e<t.length;e++){this.elements[t[e]]=true}this.type=typeof t[0]}};ISet.prototype._addOne=function(t){if(this.isEmpty()){this.type=typeof t}if(!this.elements[t]){this.elements[t]=true;return true}return false};ISet.prototype.add=function(t){var e=false;if(typeof t==="object"){for(var r=0;r<t.length;r++){e=this._addOne(t[r])||e}}else{e=this._addOne(t)}return e};ISet.prototype.clear=function(){this.elements={}};ISet.prototype.contains=function(t){return this.elements[t]||false};ISet.prototype.isEmpty=function(){return Object.keys(this.elements).length===0};ISet.prototype.remove=function(t){if(this.elements[t]){delete this.elements[t];return true}return false};ISet.prototype.asArray=function(){var t=Object.keys(this.elements);if(this.type==="number"){var e=[];for(var r=0;r<t.length;r++){e.push(Number(t[r]).valueOf())}t=e}return t};ISet.prototype.toJson=function(){return JSON.stringify(this.asArray())};ISet.prototype.toJS=function(){return this.asArray()};ISet.prototype.fromJS=function(t){return this.add(t)?this:undefined};module.exports=ISet;